import React from 'react';
import Card from './Card';
// import {robots} from './robots.js';

const CardList = ({robots}) => {
    // const cardArray = 

    return(
        <div>
            {
                        robots.map((card, i) => {
                return <Card 
                key={i} 
                id={robots[i].id} 
                name={robots[i].name} 
                email={robots[i].email} />
            })
            }
        </div>
    );
}

export default CardList;
